Er wordt opnieuw een beroep gedaan op Johnny English, de onwaarschijnlijke geheim agent in de Britse geheime dienst. Na zijn laatste perikelen heeft MI-7's Johnny English zijn vaardigheden bijgespijkerd in een afgelegen Aziatisch gebied. Maar wanneer zijn leidinggevenden lucht krijgen van een moordpoging op de Chinese president, wat een wereldchaos zal veroorzaken, gaan zij onmiddellijk op zoek naar hun onorthodoxe agent. Johnny moet wederom high-tech gadgets besturen om een web van list en bedrog te ontrafelen waarbij MI-7, de CIA en de KGB betrokken zijn.


